Rebus - The Hanging Garden   (2000)




 The Hanging Garden 
A pharmaceutical factory appears to be the major supply source of cocaine over which a gun battle is being planned by the upstart gang leader and his group of thugs. Rebus' old friend and workmate, DI Jack Morton is on an undercover assignment at the drugs plant when the attack is made, and he receives fatal gunshot wounds. Another victim of these criminals is a young mother, Candice, who was kidnapped from Cosovo to work as a prostitute, and time is of the essence if Rebus going to help her see her young son again. Sammy, Rebus' 19-year-old daughter, provides a ... 


